import React, {Component} from 'react';
import {Redirect} from 'react-router-dom';

class AddressFormComponent extends Component {
    constructor(props) {
        super(props);

        this.handleChange = this.handleChange.bind(this);
        this.state = {
            value: "",
            Street_address: "",
            housing_type: "",
            Apt_no: ""
        };
    }

    handleChange = (e) => {
        const {name, value} = e.target;
        this.setState({[name] : value});

        let  childFamilyData= { addressData :{
            Street_address: this.state.Street_address,
            Apt_no: this.state.Apt_no,
            housing_type: e.target.value }
        };
        this.props.onSelectedChild(childFamilyData);
    };


    render() {
            return (
                <div>
                    {this.state.message}

                     <p><label>Address</label><input  onChange={this.handleChange} name="Street_address" id="Street_address" type="text"/></p>
                     <p><label>Housing type</label><input onChange={this.handleChange} name="housing_type" id="housing_type" type="text" /></p>
                     <p><label>Apt No</label><input onChange={this.handleChange} name="Apt_no" id="Apt_no" type="text"/></p>
                </div>
            )
        }
    }
export default AddressFormComponent;
